function App() {
  return (
    <div className="flex">
      <aside className="w-64 p-4 border-r">
        <h1 className="text-2xl font-bold mb-4">ðŸŽ¨ Editify</h1>
        <button className="w-full px-4 py-2 bg-blue-500 text-white rounded mb-2">Upload</button>
